        state.datosRelevantes.find((relevante) => relevante.ID_VARIABLE === payload.ID_VARIABLE).VALOR = payload.VALOR
    },
    ADD_RELEVANTEVALUE(state, payload) {
        state.datosRelevantes.push(payload)
    },

